import { useEffect, useState } from "react";
import {useNavigate} from "react-router-dom";


import {
  MDBValidation,
  MDBValidationItem,
  MDBInput,
  MDBInputGroup,
  MDBBtn,
  MDBCheckbox
} from 'mdb-react-ui-kit';


function Update() {


  const [lead, setLead] = useState({
    id:"",
      fname:"",
      lname:"",
      c_name:"",
      c_number:"",
      comment:"",
      country:"",
      created_by:"",
      email:"",
      interest:"",
      lead_source:"",
      lead_type:""
     
  });

  var navigate = useNavigate();

  // const handleChange = (e) => {
  //   var copyOfLead = { ...lead };
  //   copyOfLead[e.target.id] = e.target.value;
  //   //set the form values
  //   setLead(copyOfLead);
  // };

  useEffect(()=>{
      
    const user_id=sessionStorage.getItem("id");

    console.log(user_id+"This is get session")

    var helper = new XMLHttpRequest();

    
    const url="http://localhost:8080/user/lead/"+user_id

    helper.onreadystatechange=()=>{

  
        if(helper.readyState === 4 )
        {
          console.log(helper);
            var result=JSON.parse(helper.responseText);

            console.log("this is result "+result)
            
            
            setLead(result)

            console.log(result)
            
        }
    }

  
    helper.open("GET",url)
    helper.setRequestHeader("Content-Type", "application/json")
    helper.send()

    

  },[]);

  // const submit=()=>{
    
    
  //   var userObjectInStringFormat = JSON.stringify(lead);
  
  //   console.log(userObjectInStringFormat);
    
  //   var helper = new XMLHttpRequest();
  //   helper.onreadystatechange=()=>{
      
  //     if(helper.readyState==4 && helper.status==201)
  //     {
   
      
  //       var result=JSON.parse(helper.responseText);
  //        if(result!=null)
  //       {
  //         alert("Registation done...!!!")
  //        navigate("/")
  //       }
  
  //     }
  
      
  // };
  // helper.open("POST","http://localhost:8080/user/lead");
  
  // helper.setRequestHeader("content-type","application/json")
  
  // helper.send(userObjectInStringFormat);
  // };


 
  


  const onChange = (e) => {
    var copyOfLead = { ...lead };
    copyOfLead[e.target.id] = e.target.value;
    //set the form values
    setLead(copyOfLead);
  };

    return (
      <>
      <br></br>
      <br></br>
      <MDBValidation className='row g-3'>
      <MDBValidationItem className='col-md-4'>
        <MDBInput
          value={lead.fname}
          name='fname'
          onChange={onChange}
          id='fname'
          required
          label='First name'
        />
      </MDBValidationItem>
      <MDBValidationItem className='col-md-4'>
        <MDBInput
          value={lead.lname}
          name='lname'
          onChange={onChange}
          id='lname'
          required
          label='Last name'
        />
      </MDBValidationItem>
      <MDBValidationItem feedback='Please choose a username.' invalid className='col-md-4'>
        <MDBInputGroup textBefore='@'>
          <input
            type='text'
            className='form-control'
            value={lead.email}
            id='email'
            placeholder='Email'
            required
          />
        </MDBInputGroup>
      </MDBValidationItem>



      <MDBValidationItem className='col-md-4'>
        <MDBInput
          value={lead.c_name}
          name='c_name'
          onChange={onChange}
          id='c_name'
          required
          label='Company name'
        />
      </MDBValidationItem>
      <MDBValidationItem className='col-md-4'>
        <MDBInput
          value={lead.c_number}
          name='c_number'
          onChange={onChange}
          id='c_number'
          required
          label='Company number'
        />
      </MDBValidationItem>
      <MDBValidationItem feedback='Please choose a username.' invalid className='col-md-4'>
      <MDBInputGroup textBefore='Country'>
          <input
            type='text'
            className='form-control'
            value={lead.country}
            id='country'
            placeholder='Country'
            required
          />
        </MDBInputGroup>
      </MDBValidationItem>
      


      <MDBValidationItem className='col-md-4'>
        <MDBInput
          value={lead.interest}
          name='interest'
          onChange={onChange}
          id='interest'
          required
          label='Interest'
        />
      </MDBValidationItem>
      <MDBValidationItem className='col-md-4'>
        <MDBInput
          value={lead.lead_source}
          name='lead_source'
          onChange={onChange}
          id='lead_source'
          required
          label='Lead Source'
        />
      </MDBValidationItem>
      <MDBValidationItem feedback='Please choose a username.' invalid className='col-md-4'>
        <MDBInputGroup textBefore='@'>
          <input
            type='text'
            className='form-control'
            value={lead.booking_type}
            id='email'
            placeholder='Email'
            required
          />
        </MDBInputGroup>
      </MDBValidationItem>






      <MDBValidationItem className='col-md-6' feedback='Please provide a valid city.' invalid>
        <MDBInput
          value={lead.country}
          name='country'
          onChange={onChange}
          id='country'
          required
          label='Country'
        />
      </MDBValidationItem>
      <MDBValidationItem className='col-md-6' feedback='Please provide a valid zip.' invalid>
        <MDBInput
          value={lead.fname}
          name='zip'
          onChange={onChange}
          id='validationCustom05'
          required
          label='Zip'
        />
      </MDBValidationItem>
      <MDBValidationItem className='col-12' feedback='You must agree before submitting.' invalid>
        <MDBCheckbox label='Agree to terms and conditions' id='invalidCheck' required />
      </MDBValidationItem>
      <div className='col-12'>
        <MDBBtn type='submit'>Submit form</MDBBtn>
        <MDBBtn type='reset'>Reset form</MDBBtn>
      </div>
    </MDBValidation>
  );
      
      
      </>
    );
  }
  
  export default Update;
